type Particle = ((Int,Int,Int),(Int,Int,Int),(Int,Int,Int))

parseInput :: String -> [Particle]
parseInput s = lines s & map (parseParticle . map read . filter (not . null) . splitWhen (\c -> c /= '-' && not (isDigit c)))
  where
    parseParticle [x,y,z,vx,vy,vz,ax,ay,az] = ((x,y,z),(vx,vy,vz),(ax,ay,az))
    parseParticle xs = error ("invalid input" ++ show xs)

updateParticle :: Particle -> Particle
updateParticle (p,v,a) = (vecAdd p (vecAdd v a), vecAdd v a, a)
  where vecAdd (x,y,z) (a,b,c) = (x+a,y+b,z+c)

part1 :: [Particle] -> Int
part1 particles = zip [0..] particles & minimumBy (compare `on` (vecSize . (\(_,_,a) -> a) . snd)) & fst
  where vecSize (x,y,z) = abs x + abs y + abs z

part2 :: [Particle] -> Int -> Int
part2 particles steps = foldl simulateStep particles [0..steps] & length
  where
    samePositions (p1,_,_) (p2,_,_) = p1 == p2
    simulateStep particles _ = groupBy samePositions particles & filter ((==1) . length) & map (updateParticle . head)

solveParts :: Int -> (Int,Int)
solveParts _ = (part1 particles, part2 particles 100)
  where particles = parseInput input

main = Aoc.timer solveParts
